// SPDX-License-Identifier: Apache 2
pragma solidity 0.8.17;
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "../structs/UnqWormholeStructs.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "../interface/IWormhole.sol";

contract UnqTreasury is Initializable {
    bytes32 _realmAddress;
    bytes32 _treasuryAuthority;
    address _denominatedCurrency;
    IWormhole core_contract;
    mapping(bytes32 => UnqWormholeStructs.MemberData) members;
    address _relayerSigner;
    mapping(address => uint256) memberDeposits;

    constructor() {
        _disableInitializers();
    }

    //TODO:Make modifier that encodes address to bytes32 format and use it in every function that accepts bytes32 sender
    modifier nonExistingMember(
        UnqWormholeStructs.AddMemberAction memory member
    ) {
        require(
            members[member.solanaAddress].solanaAddress == bytes32(0),
            "Member alredy in club!"
        );
        _;
    }

    modifier onlyAuthority(bytes32 authority) {
        require(authority == _treasuryAuthority, "Invalid permission");
        _;
    }

    modifier existingMember(bytes32 solanaAddress, address ethereumAddress) {
        require(
            members[solanaAddress].ethAddress == ethereumAddress,
            "Wrong Ethereum destination address!"
        );
        _;
    }

    modifier onlyRelayerSigner() {
        require(tx.origin == _relayerSigner, "Invalid authority call!");
        _;
    }

    modifier denominatedCurrencyRestrict() {
        require(
            _denominatedCurrency != address(0),
            "Invalid denominated currency!"
        );

        _;
    }

    event MemberAddedEvent(UnqWormholeStructs.MemberData);

    function initialize(
        bytes32 realmAddress,
        bytes32 treasuryAuthority,
        address denominatedCurrency,
        address wormholeBridge
    ) external initializer {
        _realmAddress = realmAddress;

        _treasuryAuthority = treasuryAuthority;

        _denominatedCurrency = denominatedCurrency;

        core_contract = IWormhole(wormholeBridge);

        members[treasuryAuthority] = UnqWormholeStructs.MemberData({
            solanaAddress: treasuryAuthority,
            ethAddress: tx.origin,
            status: UnqWormholeStructs.MemberStatus.Accepted,
            joinedAt: block.timestamp,
            realmAddress: _realmAddress
        });
    }

    function addNewMember(UnqWormholeStructs.AddMemberAction memory newMember)
        external
        nonExistingMember(newMember)
    {
        UnqWormholeStructs.MemberData memory memberData = UnqWormholeStructs
            .MemberData({
                realmAddress: _realmAddress,
                solanaAddress: newMember.solanaAddress,
                ethAddress: newMember.ethAddress,
                status: UnqWormholeStructs.MemberStatus.Accepted,
                joinedAt: block.timestamp
            });
        members[newMember.solanaAddress] = memberData;
        emit MemberAddedEvent(memberData);
    }

    function receiveFunds(bytes32 memberAddress)
        external
        payable
        existingMember(memberAddress, msg.sender)
    {
        require(
            members[memberAddress].status ==
                UnqWormholeStructs.MemberStatus.Accepted,
            "Not a member"
        );
        memberDeposits[tx.origin] += msg.value;

        bytes memory vaaBytes = abi.encodePacked(memberAddress, msg.value);
        postVaa(vaaBytes);
    }

    function getMemberData(bytes32 memberAddress)
        public
        view
        returns (UnqWormholeStructs.MemberData memory)
    {
        return members[memberAddress];
    }

    function transferFunds(address payable destination, uint256 amount)
        external
        onlyRelayerSigner
    {
        if (_denominatedCurrency != address(0)) {
            destination.transfer(amount);
        } else {
            ERC20 token = ERC20(_denominatedCurrency);
            token.transferFrom(address(this), destination, amount);
        }
    }

    function claimReward(
        bytes32 solanaAddress,
        address payable destination,
        uint256 amount
    ) external existingMember(solanaAddress, destination) onlyRelayerSigner {
        if (_denominatedCurrency != address(0)) {
            destination.transfer(amount);
        } else {
            ERC20 token = ERC20(_denominatedCurrency);
            token.transferFrom(address(this), destination, amount);
        }
    }

    function depositDenominatedCurrency(bytes32 solanaAddress, uint256 amount)
        public
        denominatedCurrencyRestrict
    {
        ERC20 token = ERC20(_denominatedCurrency);

        token.transferFrom(msg.sender, address(this), amount);
        memberDeposits[msg.sender] += amount;

        bytes memory vaaBytes = abi.encodePacked(solanaAddress, amount);
        postVaa(vaaBytes);
    }

    function getDenominatedCurrency() public view returns (address) {
        return _denominatedCurrency;
    }

    function postVaa(bytes memory payload) private {
        //TODO:Use consistency level finalized on production.Check how to generate random nonce
        core_contract.publishMessage(0, payload, 0);
    }
}
